import React from 'react'
import { Header } from './headerStyle'
import Slider from "react-slick";
class header extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    dateItem = (props) => {
        return (
            <div className="dateItem">
                <span className="day">SEN</span>
                <span className="date">10</span>
            </div>
        )
    }

    render() {
        var settings = {
            dots: true,
            infinite: false,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 4,
            initialSlide: 0,
            responsive: [
                {
                    breakpoint: 1024,
                    settings: {
                        slidesToShow: 3,
                        slidesToScroll: 3,
                        infinite: true,
                        dots: true
                    }
                },
                {
                    breakpoint: 600,
                    settings: {
                        slidesToShow: 2,
                        slidesToScroll: 2,
                        initialSlide: 2
                    }
                },
                {
                    breakpoint: 480,
                    settings: {
                        slidesToShow: 1,
                        slidesToScroll: 1
                    }
                }
            ]
        };
        return (
            <Header>
                <div className="headerNav">
                    <button>
                        <span className="material-icons"> arrow_back</span>
                    </button>
                    <div className="navSideRight">
                        <div className="upTxt">
                            <p>Alamat Pengantaran</p>
                        </div>
                        <div className="botTxt">
                            <p>Tokopedia Tower</p>
                            <span className="material-icons"> keyboard_arrow_down</span>
                        </div>
                    </div>
                </div>

                <div className="headerDate">
